class Plotter:
	@staticmethod
	def GetBernsteinBasis(n, a, b):
		X = np.linspace(a, b, b - a + 1)
		return [nCk(n, k) * ((X - a) / (b - a)) ** k * (1 - ((X - a) / (b - a))) ** (n - k) for k in range(n + 1)]


	@staticmethod
	def GetSeparableBasis(n, a, b, m, c, d):
		return [np.outer(Y, X) for X in Plotter.GetBernsteinBasis(n, a, b) for Y in Plotter.GetBernsteinBasis(m, c, d)]


	@staticmethod
	def ConstructImage(C, B):
		return (np.einsum('i, ijk -> jk', C, B) <= 0).astype(float)


	@staticmethod
	def SorensenDiceCoefficient(image, reconstruction):
		truePositive = np.sum((image == reconstruction) * image)
		falsePositive = np.sum((image != reconstruction) * reconstruction)
		falseNegative = np.sum((image != reconstruction) * image)
		return 2 * truePositive / (2 * truePositive + falsePositive + falseNegative)


	@staticmethod
	def GetNonSeparableBasis(n, L):
		x, y = np.meshgrid(np.linspace(0, L, L + 1), np.linspace(0, L, L + 1))
		res = []
		for i in range(n + 1):
			for j in range(n - i + 1):
				res.append(nCk(n, i) * nCk(n - i, j) * x ** i * y ** j * (L - x - y) ** (n - i - j) / L ** n)
		return res


	@staticmethod
	def GetPowerBasis(n, a, b):
		X = np.linspace(a, b, b - a + 1)
		return [X ** k for k in range(n + 1)]


	@staticmethod
	def GetBivariateBasis(n, a, b, c, d):
		X, Y, B = Plotter.GetPowerBasis(n, a, b), Plotter.GetPowerBasis(n, c, d), []
		for i in range(n + 1):
			for j in range(n - i + 1):
				B.append(np.outer(Y[j], X[i]))
		return B


