		reconstruction = self.ConstructImage(coefficients, self.GetNonSeparableBasis(self.n, self.L))[: self.L // 2 + 1, : self.L // 2 + 1]
		reconstruction = max(reconstruction, 1 - reconstruction, key=lambda x: self.SorensenDiceCoefficient(image, x))
